import './App.css';
import Home from './Component/Home/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Header from './Component/Header/Header';
import NotFound from './Component/NotFound/NotFound';

function App() {
  return (
    <div className="App">

      <Header></Header>
      <Router>
        <Switch>
          <Route path="/home">
            <Home />
          </Route>

          <Route exact path="/">
            <Home></Home>
          </Route>



        </Switch>
      </Router>
      <Home></Home>

    </div>
  );
}

export default App;
